const Search = ({ searchValue, setSearchedValue }) => {
  return (
    <div className="row">
      <div class="d-flex justify-content-end mb-3">
        <input
          type="text"
          class="form-control"
          placeholder="Search"
          onChange={(e) => setSearchedValue(e.target.value)}
          value={searchValue}
        />
      </div>
    </div>
  );
};
export default Search;
